import React from 'react';

import './index.css';

function Signup() {
	return (
		<div className='Signup'>
			<div className='signup-id'></div>
			<div className='signup-pw'></div>
			<div className='signup-btn'></div>
			<p>Do you have an account? <span>Sign in!</span></p>
		</div>
	);
}

export default Signup;
